export const isValue = <T>(state: SetStateAction<T>): state is T => {
  return typeof state !== 'function';
};

export const setStateAction = <T>(v: SetStateAction<T>, prev: T): T => {
  if (isValue<T>(v)) {
    return v;
  }
  return v(prev);
};

